window.bookSummaryJSON = "<p>King Alexander and his guildmates have expanded Elysia into a formidable kingdom. Their ongoing battle against the Dark One and the drow wizards is escalating. Alexander works to bring together the Elves, Dwarves, and Human Kingdoms to establish the alliance proposed by the Dragon King. But the dark magic of the drow has infiltrated even the highest offices, blocking his efforts.</p> <p>War comes once again to the gates of the keep, and Alexander must find a way to defend his citizens before he can go on the offensive and take the fight to the stronghold of his enemies. All of Io, citizens and players alike, are pulled into war as the forces of darkness strive to destroy or enslave every surface city.</p> <p>Olympus is still under siege, and the threat intensifies as doctors determine it's necessary to wake Jules from her months-long slumber. Jules and Alexander prepare to meet face to face for the first time, with a little help from their friends.</p> <p>Join the Greystone Guild for this epic conclusion of a LitRPG tale of magic, monsters, wizards, and dragons.</p>"; 
